CREATE TABLE vishny00_acc.acc_orderproducts
(
    id int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT,
    product_id int(11),
    product_art varchar(255),
    product_name text,
    product_count int(11),
    product_price float,
    product_sum float,
    product_orderquant int(11),
    order_id int(11),
    document_type int(2),
    createdAt datetime NOT NULL,
    updatedAt datetime NOT NULL,
    documentStatus int(2),
    accOrderId int(11)
);
CREATE UNIQUE INDEX acc_orderproducts_id_uindex ON vishny00_acc.acc_orderproducts (id);
